import React from "react";
import  ReactDOM  from "react-dom";
import Calculator from "./app";
// import "./index.html";

ReactDOM.render(<>
                 <ol>
                    <li>Sum of numbers is {add()} </li>    
                    <li>Subtraction of numbers is {sub()} </li>    
                    <li>Division of numbers is {div()} </li>    
                    <li>Sum of numbers is {add()} </li>    
                </ol>   
    </>
    ,document.getElementById("third")
);
